The Woman who Went to War: A Great Adventure

War Documentary hosted by Kirsty Wark, published by STV in 2014 - English narration


Information
------------------------------

Reveals the story of the ladies of the Scottish Women's Hospitals who travelled 2000 miles to Serbia in Eastern Europe to deliver medical assistance. It tells the tale of a group of ordinary Scottish women who undertook an extraordinary journey to help an ally in dire need.
The Scottish Women's Hospitals was the idea of Dr Elsie Inglis, one of Scotland's first female surgeons and a prominent suffragette. The story of Elsie and her colleague's contribution throughout the war is picked up by Alan Cumming, a football fan from Cumbernauld who uncovered a memorial to the women on a trip to Belgrade in Serbia to watch a match.
Every year there is a poignant memorial service in the city of Kragujevac to remember these brave Scottish women. Meanwhile, back home, the story remained untold. Alan took it upon himself to get recognition in Scotland of their sacrifice - as many of them never came back and died far from their homeland.

